import React from 'react';
import { NavLink } from 'react-router-dom';

const AdminSidebar = ({ onLogout }) => {
  const navStyle = ({ isActive }) => ({
    color: isActive ? '#2ECC71' : '#E5E7EB',
    fontWeight: 600,
    textDecoration: 'none',
    padding: '0.7rem 1rem',
    borderRadius: '0.5rem',
    background: isActive ? '#181A20' : 'none',
    display: 'flex',
    alignItems: 'center',
    gap: '0.7rem'
  });

  const icon = txt => <span style={{ fontWeight: 700, fontSize: '1.1rem' }}>{txt}</span>;

  return (
    <div style={{ width: '250px', background: '#181A20', minHeight: '100vh', padding: '2rem 1rem', color: '#E5E7EB', position: 'sticky', top: 0, overflowY: 'auto', maxHeight: '100vh', borderRight: '2px solid #23272F' }}>
      <div style={{ fontWeight: 700, fontSize: '1.5rem', color: '#2ECC71', marginBottom: '2rem', letterSpacing: '1px' }}>Admin</div>
      <nav style={{ display: 'flex', flexDirection: 'column', gap: '1.2rem' }}>
        <div style={{ fontWeight: 600, color: '#A0AEC0', marginBottom: '0.5rem' }}>Main</div>
        <NavLink to="/admin-dashboard/home" style={navStyle}>{icon('🏠')} Home</NavLink>
        <NavLink to="/admin-dashboard/approve" style={navStyle}>{icon('✅')} Approve Subs</NavLink>
        <NavLink to="/admin-dashboard/user-plans" style={navStyle}>{icon('👥')} User Plans</NavLink>
        <NavLink to="/admin-dashboard/users" style={navStyle}>{icon('🧑‍💼')} Manage Users</NavLink>
        <NavLink to="/admin-dashboard/stats" style={navStyle}>{icon('📊')} Site Stats</NavLink>
        <NavLink to="/admin-dashboard/notifications" style={navStyle}>{icon('🔔')} Notifications</NavLink>
        <NavLink to="/admin-dashboard/plans" style={navStyle}>{icon('📦')} Plans</NavLink>
        <NavLink to="/admin-dashboard/contacts" style={navStyle}>{icon('📬')} Contacts</NavLink>
        <div style={{ fontWeight: 600, color: '#A0AEC0', margin: '1.2rem 0 0.5rem' }}>Advanced</div>
        <NavLink to="/admin-dashboard/analytics" style={navStyle}>{icon('📈')} Analytics</NavLink>
        <NavLink to="/admin-dashboard/settings" style={navStyle}>{icon('⚙️')} Settings</NavLink>
        <NavLink to="/admin-dashboard/logs" style={navStyle}>{icon('📝')} Logs</NavLink>
        <NavLink to="/admin-dashboard/feedback" style={navStyle}>{icon('💬')} Feedback</NavLink>
        <NavLink to="/admin-dashboard/support" style={navStyle}>{icon('🆘')} Support</NavLink>
        <NavLink to="/admin-dashboard/experiments" style={navStyle}>{icon('🧪')} Experiments</NavLink>
        <NavLink to="/admin-dashboard/tools" style={navStyle}>{icon('🛠️')} Tools</NavLink>
        <NavLink to="/admin-dashboard/integrations" style={navStyle}>{icon('🔗')} Integrations</NavLink>
        <NavLink to="/admin-dashboard/logout" style={navStyle}>{icon('🚪')} Logout</NavLink>
      </nav>
    </div>
  );
};

export default AdminSidebar;
